            label: "medanmediainfo",
            raw_cities: [],
            title:
              'Fakta baru dan menarik terkait Operasi Tangkap Tangan (OTT) Komisi Pemberantasan Korupsi (KPK) di wilayah Sumatera Utara.\u00a0 Operasi senyap tersebut digelar selama tiga hari, mulai Kamis (26/6/2025) hingga Sabtu (28/6/2025) di Kabupaten Mandailing Natal dan Kota Medan, Provinsi Sumatera Utara. OTT KPK ini terbagi dalam dua klaster, yakni tindak pidana korupsi terkait proyek pembangunan jalan di DINAS PUPR PROVINSI SUMATERA UTARA, dan tindak pidana korupsi proyek preservasi jalan di SATUAN KERJA PEMBANGUNAN JALAN NASIONAL (PJN) WILAYAH 1 SUMATERA UTARA.\u00a0 Sebagaimana penjelasan dari Plt Deputi Penindakan dan Eksekusi KPK, Asep Guntur Rahayu, bahwa terkait proyek pembangunan jalan di DINAS PUPR PROVINSI SUMATERA UTARA, bermula saat Kepala Dinas PUPR Sumut, TOP (Topan Obaja Putra Ginting) dan RES (Rasuli Efendi Siregar) selaku Kepala UPTD Gunung Tua Dinas PUPR Prov. Sumut merangkap Pejabat Pembuat Komitmen (PPK) melakukan survei langsung ke lokasi jalan yang akan dibangun di Desa Sipiongot pada 22 April 2025. Pada peninjauan lokasi jalan yang akan dibangun ini, KIR (M.Akhirun Piliang) selaku Direktur Utama PT DNG juga ikut bersama Topan dan Rasuli. Padahal proses pengadaan barang dan jasa belum berlangsung.\u00a0 Topan kemudian disebut sudah memerintahkan Rasuli untuk menunjuk Akhirun alias Kirun sebagai rekanan/penyedia pengadaan barang dan jasa untuk proyek pembangunan jalan Sipiongot Batas Labusel dan Proyek pembangunan jalan Hutaimbaru-Sipiongot, dengan total nilai kedua proyek tersebut sebesar Rp157,8 miliar. Kirun kemudian dihubungi oleh Rasuli yang memberitahukan bahwa pada bulan Juni 2025 akan tayang proyek pembangunan jalan dimaksud. Rasuli juga meminta Kirun menindaklanjutinya dan memasukkan penawaran. Kemudian, pada tanggal 23 sampai 26 Juni 2025, Kirun memerintahkan stafnya untuk berkoordinasi dengan Rasuli dan staf UPTD untuk mempersiapkan hal-hal teknis sehubungan dengan proses e-catalog. Selanjutnya Kirun bersama-sama Rasuli dan staf UPTD mengatur proses ecatalog sehingga PT DGN dapat menang proyek pembangunan jalan Sipiongot Batas Labusel. Untuk proyek lainnya disarankan agar penayangan paket diberi jeda seminggu agar tidak terlalu mencolok. Bahwa atas pengaturan proses e-catalog di Dinas PUPR Pemprov Sumut tersebut terdapat pemberian uang dari Kirun dan RAY (M. Rayhan Dulasmi Piliang) alias Rayhan untuk Rasuli yang dilakukan melalui transfer rekening. Selain itu juga diduga terdapat penerimaan lainnya oleh Topan dari Kirun dan Rayhan melalui perantara.\u00a0 Nah, fakta yang ditemukan Nusantaraterkini.co berdasarkan penelusuran, Sabtu (28/6/2205), bahwa pada tanggal 22 April 2025, Gubernur Sumatera Utara Muhammad Bobby Afif Nasution juga ikut meninjau ke lokasi jalan yang akan dibangun di jalan Sipiongot - Batas Labuhan Batu dan Sipiongot - Tolang di Kabupaten Padang Lawas Utara.\u00a0 Hal tersebut berdasarkan postingan Instagram @puprprovsu_gunungtua yang berkolaborator dengan Instagram Dinas PUPR Sumut\u00a0 dan akun Instagram @rasuliserigar pada tanggal 22 April 2025. "Kunjungan Bapak Gubernur Sumatera Utara bersama Bapak Kepala Dinas PUPR Provinsi Sumatera Utara dan Kepala UPTD PUPR Gunung Tua bersama tim ke ruas jalan Sipiongot - Batas Labuhan Batu dan Sipiongot - Tolang di Kabupaten Padang Lawas Utara (22/04). Kunjungan ini bertujuan untuk meninjau rencana peningkatan struktur jalan kewenangan Provinsi di bidang infrastruktur sesuai dengan instruksi Gubernur Sumatera Utara untuk meningkatkan perekonomian masyarakat yang terkoneksi di ruas jalan tersebut. @bobbynst @topanginting @rasulisiregar @dinaspuprprovsu #DinasPUPRSumut #KolaborasiSumutBerkah #uptdpuprgunungtua" Demikian isi tulisan postingan tersebut. Postingan ini juga menyertakan beberapa foto saat peninjauan lokasi jalan serta foto-foto saat Bobby Nasution menyapa masyarakat setempat.\u00a0 Di Instagram Bobby Nasution juga diposting foto dan video saat ia ikut langsung menelusuri jalan-jalan rusak yang akan dibangun oleh Dinas PUPR Sumut.\u00a0 lanjut di kolom komentar... #medanmediainfo #medan #sumut #reels',
